import React from 'react'
import './Main.css'
import logo from '../../assets/logo.png';

const Main = () => {
    return (
        <div className="container-main">
            <h1>Chatbot</h1> <br />
            <img
            src= {logo}
            width='50%'
            alt='logo'/>
        </div>
    )
}

export default Main
